import React from "react";

const ListGroup = () => {
  return (
    <ul class="list-group">
      <li class="list-group-item active">Home</li>
      <li class="list-group-item">Libor</li>
      <li class="list-group-item">Email Wizards</li>
      <li class="list-group-item">Rules Extraction</li>
      <li class="list-group-item">Document Digitization</li>
    </ul>
  );
};

export default ListGroup;
